#include <vector>
#include <iostream>
using  namespace  std;
int main(){
    int n;
    unsigned long long x;
    cin >> n >> x;
    // 接下来一行一个长度为N的只包含U,L,R三种字母的字符串。
    string orders = "";
//    cin >> orders;
    //输出一行一个正整数，表示当前所在城市的编号。
    for(char order: orders){
        if(order == 'U'){
            // if(x == 1) x = 1;
            x = x/2;
        }else if(order == 'L'){
            x = 2*x;
        }else x = 2*x +1;
    }
    cout << x << endl;
    return 0;
}